import React from 'react';
import './App.css';
import NavBar from './navbar';
import { Outlet } from 'react-router-dom';

function Layout() {
  return (
    <div className="App min-vh-100 d-flex justify-content-center align-items-center">
      <NavBar />
      <Outlet />
    </div>
  );
}

export default Layout;
